import React from 'react';
import { Grid, Image, Button, Header, Label, Container } from 'semantic-ui-react';

const ListingPage = ({ listing }) => {
  return (
    <Container>
    <Grid width={16} divided="vertically">
      <Grid.Row>
        <Image src={listing.images[0]} />
      </Grid.Row>
      <Grid.Row>
        <Header>
          {listing.game}
          <Header.Subheader content={listing.description} />
        </Header>
      </Grid.Row>
      <Grid.Row>
        <Label content={listing.genre} />
      </Grid.Row>
    </Grid>
    </Container>
  );
};

export default ListingPage;
